// Card.js
import React from 'react';
import Button from './Button'; // Import the Button component

const Card = ({ title, content, buttonText, onButtonClick }) => {
  return (
    <div className="card">
      <h2>{title}</h2>
      <p>{content}</p>
      <Button onClick={onButtonClick} label={buttonText} />
    </div>
  );
};

export default Card;
